  height: 60px;
  display: flex;
  justify-content: space-between;
  border-bottom: 1px solid #eaeaea;
`;

export const Logo = styled.div`

`;

export const HeaderItems = styled.div`
display: flex;
justify-content: space-between;
`;

export const HeaderItem = styled.div`
  margin-right: 30px;
`;

export const HeaderContainer = styled.div`

`;
